import React from 'react'

const UserData = ({users}) => {
  return (
    <>
      {
        users.map((curUser)=>{
            const {id,first_name,last_name,email,car,city,income,gender,quote,phone_price}=curUser;

            return(
                <tr key={id}>
                    <td>{id}</td>
                    <td>{first_name}</td>
                    <td>{last_name}</td>
                    <td>{email}</td>
                    <td>{gender}</td>
                    <td>{income}</td>
                    <td>{car}</td>
                    <td>{city}</td>
                    <td>{quote}</td>
                    <td>{phone_price}</td>
                </tr>
            )
        })
      }
    </>
  )
}

export default UserData
